import { BlurbsBox }    from './blurbs/blurbs';
import { CompaniesBox } from './companies/companies';
import { ContactBox }   from './contact/contact';
import { DetailsBox }   from './details/details';
import { FriendsBox }   from './friends/friends';
import { Header }       from './header/header';
import { InterestsBox } from './interests/interests';
import { NetworkBox }   from './network/network';
import { ProfilePic }   from "./profile-pic/profile-pic";
import { SchoolsBox }   from './schools/schools';

export {
  BlurbsBox,
  CompaniesBox,
  ContactBox,
  DetailsBox,
  FriendsBox,
  Header,
  InterestsBox,
  NetworkBox,
  ProfilePic,
  SchoolsBox,
}
